import React from 'react';
import bg from './background.jpg';
import './App.css';

function App() {
  return (
    <div className=" bg-black h-screen relative">
        <img src={bg} className="bg-cover  h-full absolute h-full opacity-50 " />
        <div className='container mx-auto py-10 '>
            <h1 className='text-4xl text-center text-gray-100	uppercase font-mono '>Thi trắc nghiệm bằng lái xe A1</h1>
        </div>
    </div>
  );
}

export default App;
